import './App.css';

const exampleData = [
  {
    name: "test",
    date: "02/02/21",
    creator: "Darth Vader",
    ingredients: {},
    instructions: "Shake for 10 seconds.",
    description: "very good",
  },
  {
    name: "south side",
    date: "02/02/21",
    creator: "Jar Jar",
    ingredients: {},
    instructions: "Shake for 10 seconds.",
    description: "very good",
  },
]

function Cocktail({data}) {
  return (
    <div>
      {data.name}
    </div>
  );
}

function App() {
  return (
    <div>
      <h1>JADE Cocktail App</h1>
      {
        exampleData.map(cocktail => {
          return <Cocktail data={cocktail} />
        })
      }
    </div>
  );
}

export default App;
